import React from "react";
// import AutoplaySlider from 'react-awesome-slider';
import AwesomeSliderStyles from 'react-awesome-slider/src/styled/fold-out-animation/fold-out-animation.scss';
import AwesomeSlider from "react-awesome-slider";


import image1 from "assets/img/image/carousel/c1.webp";
import image2 from "assets/img/image/carousel/c2.webp";
import image3 from "assets/img/image/carousel/c3.webp";

export default function SectionCarousel(){
  return(<div>
  <AwesomeSlider
    play={true}
    cancelOnInteraction={false}
    interval={5000}
    cssModule={AwesomeSliderStyles}
  >
    <div data-src={image1} />
    <div data-src={image2} />
    <div data-src={image3} />
    <div data-src={image3} />
  </AwesomeSlider>
  </div>
  );
}
